// Logo.js
import React, { useState, useEffect } from 'react';
import '../style/Logo.css';

const Logo = () => {
  const [animationComplete, setAnimationComplete] = useState(false);
  const [positionY, setPositionY] = useState(0);

  useEffect(() => {
    const targetY = 3;
    const speed = 0.01;

    const animateLogo = () => {
      if (positionY < targetY) {
        setPositionY((prevPosition) => prevPosition + speed);
      } else {
        setAnimationComplete(true);
      }
    };

    const animationFrame = requestAnimationFrame(animateLogo);

    return () => cancelAnimationFrame(animationFrame);
  }, [positionY]);

  return (
    <div
      style={{
        position: 'relative',
        top: `${positionY}px`,
      }}
      className={`logo-text ${animationComplete ? 'animation-complete' : ''}`}
    >
      <div className="white-text">Diving</div>
      <div className="blue-text">ES</div>
    </div>
  );
};

export default Logo;
